mix 2 min low 
1 hour autolyse 
11 g Gray Sea Salt 2.2%
mix 3 min medium-low
---
4 hour bench rest (3 folds), pre-shape, 30 minute bench rest, shape, 20 hour bulk fermentation in fridge, bake
---
